import "./App.css";
import { Routes, Route } from "react-router-dom";
import Main from "./pages/MainPage";
import Header from "./components/common/Header";

function App() {
  return (
    <>
      <Header />
      <Routes>
        <Route path="/" element={<Main />} />
      </Routes>
    </>
  );
}

export default App;
